angular.module("listaTelefonica").factory("contatosApi",function(n,o){return{getContatos:function(){return n.get(o.BASE_URL+"/contatos")},getContato:function(t){return n.get(o.BASE_URL+"/contatos/"+t)},saveContato:function(t){return n.post(o.BASE_URL+"/contatos",t).then(function(t){return t.config.data})}}});